import { useReducer } from 'react';
import { Button } from 'antd';

function UseReducer() {

  const reducer = (state, act) => {
    switch (act.type) {
      case 'inc':
        state.val += act.num;
        break;
      case 'des':
        state.val -= act.num;
        break;
      default:
        alert('erro');
    }
    return state;
  };


  const [state, dispatch] = useReducer(reducer, { val: 0 });
  
  return (
  <>
    <div className="text-center">
      <h1>{state.val}</h1>

    </div>
  </>
  );
}
export default UseReducer;
